import AllEpisodes from "./components/AllEpisodes";
import episodeData from "./ShowData.json";

function App() {
  return (
  <>
  {episodeData.map((episode) => (
        <AllEpisodes
          key={episode.id} 
          // episode={episode}
          name={episode.name}
          season={episode.season}
          number={episode.number}
          // image={episode.image}
          summary={episode.summary}
          />
          ))}
  </>
  );
}

export default App;
